import React from "react";
import ReactDOM from "react-dom";
import comp from "./App";

ReactDOM.render(
  <>
    <h1>Hi my name is zaeem</h1>
    <ol>
      <li>zaeem</li>
      <li>{comp}</li>
    </ol>
  </>,
  document.getElementById("root")
);
